(29, 2, 'about_text', 'Добрый день, друзья! Мы предлагаем широкий выбор блюд, которые подходят для любого мероприятия - от корпоративных вечеринок до свадебных торжеств. \r\nМы покажем, что каждое блюдо может быть не только вкусным, но и красиво оформленным - быть настоящим украшением вашего мероприятия.'),
