(6612, 1035, 'about_text', 'Добрый день, друзья! Мы предлагаем широкий выбор блюд, которые подходят для любого мероприятия - от корпоративных вечеринок до свадебных торжеств. Следим за тем, что бы каждое блюдо было не только вкусным, но и красиво оформленным. Мы уверены, что наши блюда станут настоящим украшением вашего мероприятия.'),
