(7533, 1030, 'rules', '1)	Предложение на сайте не является публичной офертой.\r\n<br>2)	Таблица которую вы получите  во время просчета меню является предварительным просчетом. \r\n<br>3)	Бронирование даты происходит только после внесения задатка в размере 50% (пятьдесят) от суммы заказа, последующие 50% вносятся в день мероприятия. \r\n<br>4)	Просим вас предупредить об имеющихся у вас непереносимостях продуктов и об аллергиях. \r\n                <br>   5)	Мы не несем ответственности за продукты и напитки принесенные вами. \r\n<br>6)	При заказе мероприятий на природе или в море (на яхтах) просим учесть, что в случае невозможности выхода в море по причине плохой погоды или иным причинам, мы готовы перенести ваше торжество на предложенную вами площадку (в этот же день). Вернуть средства возможно не позднее чем за 72 часа до начала вашего мероприятия. \r\n                <br>  7)	При отказе от мероприятия в день его проведения задаток не возвращается. \r\n                <br>  8)	Возврат средств осуществляется в течении 14 дней с момента оплаты. \r\n                <br>  9)	Для получения лучшего качества блюд мы закупаем продукты непосредственно перед вашим торжеством, есть вероятность отсутствия чего либо. Оставляем за собой право, заменить продукты на аналогичные такого же качества.\r\n<br> 10) Обслуживание, доставка и необходимая мебель оплачивается отдельно.\r\n<br> 11) Доставка осуществляется рефрежератором (стоимость по Сочи от 2500 р, Адлер от 4000 р., Красная Поляна от 7000 р. или в районе 10% от суммы заказа).\r\n'),
