(1182, 1, '2023-11-08 13:37:10', '2023-11-08 10:37:10', 'a:8:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:4:\"page\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:4:\"1030\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"description\";s:0:\"\";s:12:\"show_in_rest\";i:0;}', 'Условия работы', 'usloviya-raboty', 'publish', 'closed', 'closed', '', 'group_654b63eee4420', '', '', '2023-11-08 13:37:24', '2023-11-08 10:37:24', '', 0, 'https://kamanas.ru/?post_type=acf-field-group&#038;p=1182', 0, 'acf-field-group', '', 0),
(1183, 1, '2023-11-08 13:37:10', '2023-11-08 10:37:10', 'a:11:{s:10:\"aria-label\";s:0:\"\";s:4:\"type\";s:8:\"textarea\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:2170:\"1)	Предложение на сайте не является публичной офертой.\r\n2)	Таблица которую вы получите  во время просчета меню является предварительным просчетом. \r\n3)	Бронирование даты происходит только после внесения задатка в размере 50% (пятьдесят) от суммы заказа, последующие 50% вносятся в день мероприятия. \r\n4)	Просим вас предупредить об имеющихся у вас непереносимостях продуктов и об аллергиях. \r\n                <br>   5)	Мы не несем ответственности за продукты и напитки принесенные вами. \r\n6)	При заказе мероприятий на природе или в море (на яхтах) просим учесть, что в случае невозможности выхода в море по причине плохой погоды или иным причинам, мы готовы перенести ваше торжество на предложенную вами площадку (в этот же день). Вернуть средства возможно не позднее чем за 72 часа до начала вашего мероприятия. \r\n                <br>  7)	При отказе от мероприятия в день его проведения задаток не возвращается. \r\n                <br>  8)	Возврат средств осуществляется в течении 14 дней с момента оплаты. \r\n                <br>  9)	Для получения лучшего качества блюд мы закупаем продукты непосредственно перед вашим торжеством, есть вероятность отсутствия чего либо. Оставляем за собой право, заменить продукты на аналогичные такого же качества.\";s:9:\"maxlength\";s:0:\"\";s:4:\"rows\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:9:\"new_lines\";s:0:\"\";}', 'Условия работы (список)', 'rules', 'publish', 'closed', 'closed', '', 'field_654b63efcc2c4', '', '', '2023-11-08 13:37:10', '2023-11-08 10:37:10', '', 1182, 'https://kamanas.ru/?post_type=acf-field&p=1183', 0, 'acf-field', '', 0),
